import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CategoryComponent } from './category/category.component';



@NgModule({
  declarations: [
    CategoryComponent
  ],
  imports: [
    CommonModule
  ]
})
export class CategoryModule { }
